  `buyer_id` int NOT NULL,
  `product_id` int NOT NULL,
  `delivery_id` int NOT NULL,
  `date` date DEFAULT NULL,
  `time` int DEFAULT NULL,
  `status` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `price` int DEFAULT NULL,
  `priceDelivery` int DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  KEY `buyer_id` (`buyer_id`),
  KEY `product_id` (`product_id`),
  KEY `delivery_id` (`delivery_id`),
  CONSTRAINT `productorder_ibfk_1` FOREIGN KEY (`buyer_id`) REFERENCES `buyer` (`buyer_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `productorder_ibfk_2` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `productorder_ibfk_3` FOREIGN KEY (`delivery_id`) REFERENCES `deliveryperson` (`delivery_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT CHECK (status IN ('Во Процес', 'Во обработка', 'Доставена'))
